import React from 'react'
import Typed from 'react-typed';


const Hero = () => {
  return (
    <div className="text-white">
        <div className='max-w-[800px] mt-[-96px] w-full h-screen mx-auto text-center flex flex-col justify-center'>
        <p className='md:text-2xl text-[#05386b] font-bold p-2' > Welcome To My Website</p>
        <h1 className='md:text-7xl sm:text-6xl text-4xl font-bold md:py-4'> Mar-Tec</h1>
            <div className='flex justify-center items-center'>
            <p className='md:text-3xl sm:text-4xl text-xl font-bold '> Fast, Flexible Use</p> 
           
            <Typed className='md:text-3xl sm:text-4xl text-xl font-bold md:pl-4 pl-2' 
            strings={[' Website', 'IoT', 'Data']} 
            typeSpeed={120} 
            backSpeed={130} 
            loop 
            />

            </div>
            <p className='md:text-xl sm:text-1xl text-xl  md:py-4 font-bold text-gray-500'> Mengembangkan Ilmu Teknologi yang ada sekarang dengan cara berfikir Komputasional</p>
        </div>
    </div>
  )
}

export default Hero
